import React, { Component } from 'react'
import './App.css'
import CreateTask from './Tasks/CreateTask'
import TasksManager from './Tasks/TasksManager'
import { Tabs, Tab } from 'react-bootstrap'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      'active_tab': 1,
    }
  }

  render() {
    const { active_tab } = this.state

    return (
      <div className="App">
        <header className="App-header">
            <div>
              <Tabs activeKey={active_tab} onSelect={this.handleSelect} id="controlled-tab-example">
                  <Tab eventKey={1} title={"Create task"}>
                    {CreateTask}
                  </Tab>
                  <Tab eventKey={2} title={"Manage task"}>
                    {TasksManager}
                  </Tab>
              </Tabs>
              <TasksManager />
            </div>
        </header>
      </div>
    );
  }
}

export default App;
